import React, { Component } from 'react'
import "./P.css";
class P extends Component {
  render() {
    return (<>
      <div className="div1">
        <h1 className="firstclass">Hello world</h1>
        </div>
      
         <p style={{color:"red",fontSize:"50px"}}>Myself disha shah, nice to meet you</p>
   
         </>
    )
  }
}
export default P;
